import React from 'react';
import ReactDOM from 'react-dom';

class App extends React.Component{
  render(){
    var element;
    if(this.props.celsius >= 100){
      return <p>Water will be boiled</p>
    }
    return (
      <p>Water wont be boiled</p>
    )
  }
}

ReactDOM.render(
    <App />,
    document.getElementById('root')
);
